module Tables = struct
  
  include MenhirBasics
  
  let token2terminal : token -> int =
    fun _tok ->
      match _tok with
      | AMPERAMPER ->
          128
      | AMPERSAND ->
          127
      | AND ->
          126
      | AS ->
          125
      | ASSERT ->
          124
      | BACKQUOTE ->
          123
      | BANG ->
